        [Test]
        public void TestBlockDecodeJsonWithTxsWithInnerTx()
        {
            // data from block 52243617 using json encoding, header only
            var data = "";

            using Stream responseStream = new System.IO.MemoryStream(Convert.FromBase64String(data));
            using var streamReader = new System.IO.StreamReader(responseStream);
            using var reader = new JsonTextReader(streamReader);
            var JsonSerializerSettings = new Newtonsoft.Json.JsonSerializerSettings();
            var serializer = Newtonsoft.Json.JsonSerializer.Create(JsonSerializerSettings);
            var typedBody = serializer.Deserialize<Algorand.Algod.Model.CertifiedBlock>(reader);

            Assert.That(typedBody, Is.Not.Null);
            Assert.That(typedBody.Block.Round, Is.EqualTo(52243617));
            Assert.That(typedBody.Block.Transactions.Count, Is.EqualTo(31));
            var tx = typedBody.Block.Transactions.First().Tx;
            var assetTransferTx = tx as AssetAcceptTransaction;
            Assert.That(assetTransferTx.XferAsset, Is.EqualTo(924268058));
            Assert.That(Encoding.UTF8.GetString(assetTransferTx.Note), Is.EqualTo("Connectivity Check for DC:46:28:46:FD:57"));
            Assert.That(assetTransferTx.Sender.EncodeAsString(), Is.EqualTo("UDG7ANHIU7QFSHGEPY77RY4LAFCVUJQLZ3SJ3FXL7FAIDYSMKZ5TVDQO6Y"));
            Assert.That(assetTransferTx.AssetReceiver.EncodeAsString(), Is.EqualTo("DSOPUQC7P5WO3C32HKZONPW4MMBEQ6FGAN456PNG4A4HTRE322ZMMIK6S4"));
            Assert.That(assetTransferTx.FirstValid, Is.EqualTo(52243614));
            Assert.That(assetTransferTx.LastValid, Is.EqualTo(52244614));
            Assert.That(assetTransferTx.Fee, Is.EqualTo(1000));

            tx.FillInParamsFromBlockHeader(typedBody.Block);
            Assert.That(assetTransferTx.GenesisId, Is.EqualTo(typedBody.Block.GenesisId));
            Assert.That(assetTransferTx.TxID(), Is.EqualTo("UWWXJQ6S2DJ455WYVIU6SXLWYXJPUZNQ2X7RMDGXKNJIZKQMSEJA"));


            var tx2 = typedBody.Block.Transactions.Skip(2).FirstOrDefault().Tx as PaymentTransaction;
            tx2.FillInParamsFromBlockHeader(typedBody.Block);
            Assert.That(tx2.Amount, Is.EqualTo(5148218));
            Assert.That(tx2.TxID(), Is.EqualTo("X4NLWF77LBEC7FX7GFJVVUZLKWO4VX6H3R7CHDAZDRPX3W6TOWYQ"));

            var tx3 = typedBody.Block.Transactions.Skip(3).FirstOrDefault();
            var tx3Typed = tx3.Tx as ApplicationCallTransaction;
            tx3Typed.FillInParamsFromBlockHeader(typedBody.Block);
            Assert.That(Encoding.UTF8.GetString(tx3Typed.ApplicationArgs.FirstOrDefault()), Is.EqualTo("SWAP"));
            Assert.That(tx3Typed.TxID(), Is.EqualTo("CPNVQKPRZPECDY6RFIKACIMW7BUXJY5OCGDSXDT2OZBYOKPFCQ4Q"));

            Assert.That(tx3.Detail, Is.Not.Null);
            Assert.That(tx3.Detail.InnerTxns, Is.Not.Null);
            var tx3_1 = tx3.Detail.InnerTxns.FirstOrDefault().Tx as AssetTransferTransaction;
            Assert.That(tx3_1.AssetAmount, Is.EqualTo(1514135));

            var tx4 = typedBody.Block.Transactions.Skip(4).FirstOrDefault().Tx as AssetTransferTransaction;
            tx4.FillInParamsFromBlockHeader(typedBody.Block);
            Assert.That(tx4.TxID(), Is.EqualTo("46NO2KNLOO5JKVJFSIJEV3YE3C3QUL6HDTKPVEDDS66EZKDBDYLA"));


        }

