        [Test]
        public void TestBlockHeaderDecodeMsgPack2NoTxs()
        {
            // data from block 54054743  using msgpack encoding, header only
            var data = "";
            var bytes = Convert.FromHexString(data);

            // Configure MessagePack to use ContractlessStandardResolver which doesn't require MessagePackObject attributes
            var options = MessagePackSerializerOptions.Standard.WithResolver(ContractlessStandardResolver.Instance);

            var typedBody = MessagePack.MessagePackSerializer.Deserialize<Algorand.Algod.Model.CertifiedBlock>(bytes, options);

            Assert.That(typedBody, Is.Not.Null);
            Assert.That(typedBody.Block.Round, Is.EqualTo(54054743));
            Assert.That(typedBody.Block.Transactions, Is.Null);
            Assert.That(typedBody.Cert.Votes.Count, Is.EqualTo(11));
            Assert.That(typedBody.Block.Proposer, Is.Not.Null);
        }
